function roundRect(ctx, x, y, width, height, radius, fill, stroke) {
  if (typeof stroke === 'undefined') {
    stroke = true;
  }
  if (typeof radius === 'undefined') {
    radius = 5;
  }
  if (typeof radius === 'number') {
    radius = {tl: radius, tr: radius, br: radius, bl: radius};
  } else {
    var defaultRadius = {tl: 0, tr: 0, br: 0, bl: 0};
    for (var side in defaultRadius) {
      radius[side] = radius[side] || defaultRadius[side];
    }
  }
  ctx.beginPath();
  ctx.moveTo(x + radius.tl, y);
  ctx.lineTo(x + width - radius.tr, y);
  ctx.quadraticCurveTo(x + width, y, x + width, y + radius.tr);
  ctx.lineTo(x + width, y + height - radius.br);
  ctx.quadraticCurveTo(x + width, y + height, x + width - radius.br, y + height);
  ctx.lineTo(x + radius.bl, y + height);
  ctx.quadraticCurveTo(x, y + height, x, y + height - radius.bl);
  ctx.lineTo(x, y + radius.tl);
  ctx.quadraticCurveTo(x, y, x + radius.tl, y);
  ctx.closePath();
  if (fill) {
    ctx.fill();
  }
  if (stroke) {
    ctx.stroke();
  }

}

function circle(ctx, x, y, radius) {
  ctx.beginPath();
  ctx.arc(x, y, radius, 0, 2 * Math.PI);
  ctx.fill();
}

function update() {
    // current player triangle
    ctx.clearRect(180, 10, 30, 110);
    ctx.lineWidth = 0;
    ctx.strokeStyle = "red";
    ctx.fillStyle = "red";
    ctx.beginPath();

    if (current_player == USER) {
      ctx.moveTo(185,20);
      ctx.lineTo(185,40);
      ctx.lineTo(205,30);
    } else {
      ctx.moveTo(185,65 + 20);
      ctx.lineTo(185,65 + 40);
      ctx.lineTo(205,65 + 30);
    }
    ctx.closePath();
    ctx.fill();



    // user score
    var u_score = Math.min(GOAL, scores[USER]);
    var u_turn =  Math.max(Math.min(GOAL - u_score, turn_totals[USER]), 0);

    ctx.fillStyle = "black";
    ctx.font = "40px monospace";
    ctx.clearRect(SCORE_LEFT + SCORE_WIDTH + 100, USER_SCORE_TOP - 10, 80, 40);
    ctx.fillText(scores[USER], SCORE_LEFT + SCORE_WIDTH + 100, USER_SCORE_TOP + 27.5);

    ctx.clearRect(SCORE_LEFT + 80, USER_SCORE_TOP, SCORE_WIDTH, 30);
    ctx.fillStyle = "blue";
    ctx.fillRect(SCORE_LEFT + 80, USER_SCORE_TOP, SCORE_WIDTH * (u_score / GOAL), 30);
    ctx.fillStyle = "lightblue";
    ctx.fillRect(SCORE_LEFT + 80 + SCORE_WIDTH * (u_score / GOAL), USER_SCORE_TOP, SCORE_WIDTH * (u_turn / GOAL), 30);

    ctx.rect(SCORE_LEFT + 80, USER_SCORE_TOP, SCORE_WIDTH, 30);
    ctx.lineWidth = 2;
    ctx.strokeStyle = "black";
    ctx.stroke();



    // computer score
    var c_score = Math.min(GOAL, scores[COMPUTER]);
    var c_turn = Math.max(Math.min(GOAL - c_score, turn_totals[COMPUTER]), 0);

    ctx.fillStyle = "black";
    ctx.font = "40px monospace";
    ctx.clearRect(SCORE_LEFT + SCORE_WIDTH + 100, COMPUTER_SCORE_TOP - 10, 80, 40);
    ctx.fillText(scores[COMPUTER], SCORE_LEFT + SCORE_WIDTH + 100, COMPUTER_SCORE_TOP + 27.5);

    ctx.clearRect(SCORE_LEFT + 80, COMPUTER_SCORE_TOP, SCORE_WIDTH, 30);
    ctx.fillStyle = "blue";
    ctx.fillRect(SCORE_LEFT + 80, COMPUTER_SCORE_TOP, SCORE_WIDTH * (c_score / GOAL), 30);
    ctx.fillStyle = "lightblue";
    ctx.fillRect(SCORE_LEFT + 80 + SCORE_WIDTH * (c_score / GOAL), COMPUTER_SCORE_TOP, SCORE_WIDTH * (c_turn / GOAL), 30);

    ctx.rect(SCORE_LEFT + 80, COMPUTER_SCORE_TOP, SCORE_WIDTH, 30);
    ctx.lineWidth = 2;
    ctx.strokeStyle = "black";
    ctx.stroke();



    // turn Total
    ctx.fillStyle = "black";
    ctx.font = "40px monospace";
    ctx.clearRect(350, 255, 90, 40);
    ctx.fillText(turn_totals[current_player], turn_totals[current_player] < 10 ? 372 : 360, 285);



    // die
    if (current_die != 0) {

      var x_offset = 0;
      var y_offset = 0;

      ctx.fillStyle = "black";
      ctx.strokeStyle = "black";

      if (moving) {
        x_offset = Math.floor(Math.random() * 20) - 10;
        y_offset = Math.floor(Math.random() * 20) - 10;

        ctx.fillStyle = "lightgrey";
        ctx.strokeStyle = "lightgrey";
      }

      var top_die_x = 348 + x_offset;
      var top_die_y = 140 + y_offset;
      var die_size = 75;
      var dot_radius = 7;

      ctx.clearRect(WIDTH - 280, HEIGHT - 180, 130, 110);

      roundRect(ctx, top_die_x, top_die_y, die_size, die_size, 5, false, true);
      ctx.stroke();

      if (current_die == 1) {
        circle(ctx, top_die_x + (die_size / 2), top_die_y + (die_size / 2), dot_radius);
      } else if (current_die == 2) {
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
      } else if (current_die == 3) {
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (die_size / 2), top_die_y + (die_size / 2), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
      } else if (current_die == 4) {
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
      } else if (current_die == 5) {
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (die_size / 2), top_die_y + (die_size / 2), dot_radius);
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
      } else if (current_die == 6) {
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (die_size / 4), dot_radius);
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (die_size / 2), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (die_size / 2), dot_radius);
        circle(ctx, top_die_x + (die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
        circle(ctx, top_die_x + (3 * die_size / 4), top_die_y + (3 * die_size / 4), dot_radius);
      }
    }


    // side text
    var top_side = 105;
    // ctx.fillStyle = "rgb(255,0,0,0.5)";
    ctx.clearRect(5, top_side, 140, 70);
    ctx.fillStyle = "black";
    if (!is_game_over()) {
      ctx.font = "15px monospace";
      ctx.fillText("Probability", 20, top_side + 20);
      ctx.fillText("of winning:", 20, top_side + 35);
      ctx.font = "25px monospace";
      var prob_of_user_win = Math.round(pWin(scores[0], scores[1], turn_totals[0]) * 1000) / 10;
      var prob_of_comp_win = Math.round(pWin(scores[1], scores[0], turn_totals[1]) * 1000) / 10;
      var prob = (current_player == USER ? prob_of_user_win : 100 - prob_of_comp_win).toFixed(1);
      ctx.fillText(prob + "%", 35, top_side + 60);
    } else {
      ctx.font = "15px monospace";
      ctx.fillText(current_player == USER ? "   You win!    " : "Computer wins!", 10, top_side + 25);
      ctx.font = "12px monospace";
      ctx.fillText("Click to restart.", 12, top_side + 40);
    }



    // hint
    // ctx.fillStyle = "rgb(255,0,0,0.5)";
    ctx.clearRect(115, 200, 50, 45);
    if (hint && current_player == USER) {
      var x = 120;
      var y = 205;
      var w = 40;
      var h = 20;
      var radius = 5;
      var r = x + w;
      var b = y + h;
      ctx.beginPath();
      ctx.strokeStyle="black";
      ctx.lineWidth="2";
      ctx.moveTo(x+radius, y); // top left
      ctx.lineTo(r-radius, y); // top right
      ctx.quadraticCurveTo(r, y, r, y+radius); // top right bend
      ctx.lineTo(r, y + h - radius); // bottom right
      ctx.quadraticCurveTo(r, b, r - radius, b); // bottom right bend
      ctx.lineTo(x + radius * 2, b); // bottom left before the spike
      ctx.lineTo(x + radius / 2, b + 10); //
      ctx.lineTo(x + radius, b);
      ctx.quadraticCurveTo(x, b, x, b - radius);
      ctx.lineTo(x, y + radius);
      ctx.quadraticCurveTo(x, y, x + radius, y);
      ctx.stroke();
      ctx.fillStyle = "black";
      ctx.font = "12px monospace";
      ctx.fillText(shouldRoll(scores[0], scores[1], turn_totals[0]) ? "roll" : "hold", 125, 218);
    }






}
setInterval(function () {
  update();
}, 10);





